@import url("../node_modules/reset.css/reset.css");
@import url("../node_modules/normalize.css/normalize.css");
:root {
  --white: #ffff;
  --primare-color: #000000;
  --accent-color: #996b60;
}

@font-face {
  font-family: "Liberator Serif";
  src: url("./assets/font/LiberationSerif-Regular.ttf") format("truetype");
}

body {
  font-family: "Roboto", sans-serif;
  font-size: 0.875rem;
  font-weight: normal;
  line-height: 1.5;
}

[class*="-container"] {
  max-width: 1300px;
  margin: 0 auto;
  padding: 0 20px;
}

.button {
  font-size: 0.75rem;
