  position: relative;
  text-decoration: none;
  color: var(--primare-color);
  &::before {
    content: "";
    position: absolute;
    bottom: -5px;
    left: 0;
    width: 0;
    height: 2px;
    background-color: var(--primare-color);
    transition: width 0.2s ease-in-out;
  }
  &:hover {
    &::before {
      width: 100%;
      height: 2px;
    }
  }
}

.link {
  position: relative;
  &::before {
    content: "";
    position: absolute;
    bottom: -5px;
    left: 0;
    width: 0;
    height: 2px;
    background-color: var(--white);
    transition: width 0.2s ease-in-out;
  }
  &:hover {
    &::before {
      width: 100%;
      height: 2px;
    }
  }
}

.material-symbols-outlined {
  font-variation-settings: "FILL" 0, "wght" 400, "GRAD" 0, "opsz" 48;
}

.notification {
  position: relative;
  background-color: #191919;
